import logo from './logo.svg';
import './App.css';
import React from 'react';


class App extends React.Component {
  constructor() {
    super()

    this.state = {
      numeroDeCliques: 0,
    }
    this.handleClick = this.handleClick.bind(this);
    this.secHandleClick = this.secHandleClick.bind(this);
    this.thirdHandleClick = this.thirdHandleClick.bind(this);
  }

  handleClick() {
    console.log('oi');
  }

  secHandleClick() {
    console.log('teste');
  }

  thirdHandleClick() {
    console.log('trybe');
  }

  render() {
    return (
      <div>
        <button onClick={this.handleClick}>meu botão</button>
        <button onClick={this.secHandleClick}>meu botão</button>
        <button onClick={this.thirdHandleClick}>meu botão</button>
      </div>
    )
  }
}

export default App;
